import style from "../Courses.module.css";

function coursesPersonal(props) {
  let pagesArray = [];
  for (let i = 0; i < props.totalPagesCount; i++) {
    pagesArray.push(i);
  }

  if (props.personalCourse !== "") {
    return (
      <div className={style.container}>
        <div className={style.pagesCount}>
          {pagesArray.map((p) => (
            <div className={style.page}>
              <div> {p}</div>
            </div>
          ))}
        </div>
        <div className={style.personalTitle}>
          {props.personalCourse.courseName}
        </div>
        <div className={style.personalStep}>
          <div>{props.personalCourse.id}</div>
          <div>
            <div>{props.personalCourse.stepTitle}</div>
            <div>{props.personalCourse.stepType}</div>
            <div>{props.personalCourse.stepContent}</div>
          </div>
        </div>
      </div>
    );
  }
  return <div>Sorry, but smth went wrong</div>;
}
export default coursesPersonal;
